import { List, ListItem, ListItemText, Typography, Divider } from "@material-ui/core";

interface Props {
    passengers: string [];
}

const ListPassengers = ({ passengers }: Props) => {
    console.log('this is renderd')
    return (
        <>
            <Typography>Passengers</Typography>
            <Divider />
            <List>
                {passengers.map((passenger, idx) => (
                <ListItem key={idx}>
                    <ListItemText primary="Photos" />
                </ListItem>
                ))}
            </List>
        </>
    )
};

export default ListPassengers;
